import json
import base64
import uuid
import boto3
import tempfile
import os

os.environ['LOCALSTACK_S3_ENDPOINT_URL'] = 'http://localhost:4566'
os.environ['AWS_ACCESS_KEY_ID'] = 'test'
os.environ['AWS_SECRET_ACCESS_KEY'] = 'test'
os.environ['AWS_DEFAULT_REGION'] = 'us-east-1'

# Check if LOCALSTACK_S3_ENDPOINT_URL is set, use it for S3 client
if os.environ.get('LOCALSTACK_S3_ENDPOINT_URL'):
    s3_client = boto3.client("s3", endpoint_url=os.environ.get('LOCALSTACK_S3_ENDPOINT_URL'))
else:
    s3_client = boto3.client("s3")

S3_BUCKET_NAME = 'my-test-bucket'


def parse_image_from_event(event, context):
    """ Parse event and context to prepare upload """

    try:
        key = f"images/{uuid.uuid4().hex}.png"  # Generate a random key using UUID
    except KeyError:
        key = f"images/sample_file_{uuid.uuid4().hex}.png"

    try:
        image_content = event['body'].strip()  # Remove any extra whitespace/newlines
        image_content += '=' * (-len(image_content) % 4)  # Add necessary padding

        with tempfile.NamedTemporaryFile(delete=False, suffix='.png') as temp_file:
            temp_filename = temp_file.name
            temp_file.write(base64.b64decode(image_content))

        # Upload to S3
        s3_client.upload_file(temp_filename, S3_BUCKET_NAME, key)

    except Exception as exp:
        print(exp)
        raise Exception(
            f"Unknown error occurred. Check CloudWatch Logs under /aws/lambda/{context.get('function_name', 'unknown')}")  # Simulate context with default name


def lambda_handler(event, context):
    parse_image_from_event(event, context)

    return {
        'statusCode': 200,
        'body': json.dumps('Success!')
    }


if __name__ == "__main__":
    event = {
        "body": "",
    }

    context = {"function_name": "test_lambda_function"}  # Simulating context

    response = lambda_handler(event, context)
    print(response)
